import React from 'react';

import { View, Image, StyleSheet } from "@react-pdf/renderer";

import "./index.css"

export function FooterBackground({ img }) {

    return (
        <View style={styles.footer}>
            {img === '' ?
                <View style={styles.background} />
                :
                <Image style={styles.background} src={img} />
            }
        </View>
    )
}

export function FooterBackground2({ img }) {

    return (
        <div className="footerBackground">
            {img === '' ?
                <div className="footerBackground">
                </div>
                : <img className="footerBackground" src={img} />
            }
        </div>
    )
}

const styles = StyleSheet.create({
    footer: {
        width: '100%',
        height: 60
    },
    background: {
        width: '100%',
        height: 60
    }
})
